    true,nt"url": null,nt"notes": "The Hurricane and Severe Storm Sentinel
    (HS3) Global Hawk High Altitude MMIC Sounding Radiometer (HAMSR) datasets include
    measurements gathered by the HAMSR instrument during the HS3 campaign which took
    place during the hurricane seasons of 2011 through 2014 in the Atlantic Ocean basin
    region. HAMSR has 25 spectral channels in 3 bands (50-60 Ghz, 118 Ghz, 183 Ghz),
    and it provides measurements that can be used to infer the 3D distribution of temperature,
    water vapor, and cloud liquid water in the atmosphere, even in the presence of clouds.
    HAMSR is mounted in payload zone 3 near the nose of the Global Hawk NASA aircraft.
    Data is available in netCDF/CF format and, currently, only available for 2012 -
    2013.",nt"license_title": "U.S. Government Work",nt"extras": [{ntt"key":
